class BookModel {
  BookModel({
      this.kind, 
      this.totalItems, 
      this.items,});

  BookModel.fromJson(dynamic json) {
    kind = json['kind'];
    totalItems = json['totalItems'];
    if (json['items'] != null) {
      items = [];
      json['items'].forEach((v) {
        items?.add(Items.fromJson(v));
      });
    }
  }
  String? kind;
  int? totalItems;
  List<Items>? items;
BookModel copyWith({  String? kind,
  int? totalItems,
  List<Items>? items,
